import React from 'react';
import './BusModels.css';  // Import the CSS specific for this page

import bus1 from '../images/starbus.jpg';
import bus2 from '../images/bus2.jpg';
import bus3 from '../images/bus3.jpg';
import bus4 from '../images/bus4.jpg';
import bus5 from '../images/bus5.jpg';


const busModels = [
  { name: 'Bus Model 1', description: 'Description for Bus Model 1', image: 'starbus.jpg' },
  { name: 'Bus Model 2', description: 'Description for Bus Model 2', image: 'bus2.jpg' },
  { name: 'Bus Model 3', description: 'Description for Bus Model 3', image: 'bus3.jpg' },
  { name: 'Bus Model 4', description: 'Description for Bus Model 4', image: 'bus4.jpg' },
  { name: 'Bus Model 5', description: 'Description for Bus Model 5', image: 'bus5.jpg' },
];

const BusModels = () => {
  return (
    <div className="bus-models-page">
      <h2>Bus Models</h2>
      <div className="bus-models-list">
        {busModels.map((bus, index) => (
          <div key={index} className="bus-model">
            <img src={bus.image} alt={bus.name} className="bus-model-image" />
            <h3>{bus.name}</h3>
            <p>{bus.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default BusModels;
